import React from 'react';
import SocialMediaIcon from './icons/social-media.gif'; // Example path to social media icon
import FollowUsIcon from './icons/follow-us.gif'; // Example path to follow us icon
import CallUsIcon from './icons/call-us.gif'; // Example path to call us icon
import ShareIcon from './icons/share.gif'; // Example path to share icon

const Footer = () => {
  return (
    <footer className="bg-gray-800 py-4">
      <div className="container mx-auto flex justify-center items-center">
        {/* Render Social Media Icon */}
        <img src={SocialMediaIcon} alt="Social Media" className="w-8 h-8 mx-2" />
        {/* Render Follow Us Icon */}
        <img src={FollowUsIcon} alt="Follow Us" className="w-8 h-8 mx-2" />
        {/* Render Call Us Icon */}
        <img src={CallUsIcon} alt="Call Us" className="w-8 h-8 mx-2" />
        {/* Render Share Icon */}
        <img src={ShareIcon} alt="Share" className="w-8 h-8 mx-2" />
      </div>
    </footer>
  );
};

export default Footer;
